import React from "react";
import { NavLink } from "react-router-dom";
// import CommonParent from "./CommonParent";
//import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/Katie-Author-Bio-Pic.png";
const About = (props) => {
  return (
    <>
      <div className="#about" id="about">
        <h1 className="text-center">About Me</h1>
      </div>

      <section id="header" className="d-flex align-items-center">
        <div className="container-fluid">
          <div className="row">
            <div className="col-10 mx-auto align-items-center">
              <h1 className="text-center"> This is about page</h1>
              <div className="mt-3 align-items: center">
                <NavLink smooth to="#contact" className="btn-get-started">
                  Contact Me
                </NavLink>

                <NavLink smooth to="#resume" className="btn-get-started">
                  View Resume
                </NavLink>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default About;
